def solver(input_grid):
    from collections import Counter

    grid = [row[:] for row in input_grid]
    rows = len(grid)
    cols = len(grid[0]) if rows > 0 else 0
    output = [row[:] for row in grid]

    flat = [cell for row in grid for cell in row]
    non_zero = [x for x in flat if x > 0]
    if len(non_zero) == 0:
        return output

    color_counts = Counter(non_zero)
    main_colors = [c for c, _ in color_counts.most_common(2)]
    if len(main_colors) < 2:
        return output

    color1, color2 = main_colors[0], main_colors[1]

    to_convert = {}
    for i in range(rows):
        for j in range(cols):
            if grid[i][j] == 0:
                count0, count1, count2 = 0, 0, 0
                for di in range(-1, 2):
                    for dj in range(-1, 2):
                        if di == 0 and dj == 0:
                            continue
                        ni, nj = i + di, j + dj
                        if 0 <= ni < rows and 0 <= nj < cols:
                            val = grid[ni][nj]
                            if val == 0: count0 += 1
                            elif val == color1: count1 += 1
                            elif val == color2: count2 += 1

                if count1 > count0 or count2 > count0:
                    if count1 > count2:
                        to_convert[(i, j)] = (color1, color2)
                    elif count2 > count1:
                        to_convert[(i, j)] = (color2, color1)

    for (i, j) in to_convert:
        output[i][j] = 8

    for (i, j), (dominant, other) in to_convert.items():
        for di in range(-1, 2):
            for dj in range(-1, 2):
                if di == 0 and dj == 0:
                    continue
                ni, nj = i + di, j + dj
                if 0 <= ni < rows and 0 <= nj < cols:
                    orig = grid[ni][nj]
                    if orig == dominant:
                        output[ni][nj] = other
                    elif orig == 0 and (ni, nj) not in to_convert:
                        output[ni][nj] = other

    for i in range(rows):
        for j in range(cols):
            if grid[i][j] in (color1, color2):
                is_isolated = True
                for di in range(-1, 2):
                    for dj in range(-1, 2):
                        if di == 0 and dj == 0:
                            continue
                        ni, nj = i + di, j + dj
                        if 0 <= ni < rows and 0 <= nj < cols:
